import '../App.css'
import principal from '../imagenes/generales/principal.jpg'
import dimenciones from '../imagenes/iconos/dimenciones.png'
import habitaciones from '../imagenes/iconos/habitaciones.png'
import nivel from '../imagenes/iconos/nivel.png'
import {useEffect,useState} from 'react'
/*cargamos las propieadades*/




function convertirBufferaImagen(buffer)
{
    if (buffer.length > 0)
    {
        const arrayBuffer= new Uint8Array(buffer);
        const blob= new Blob([arrayBuffer],{type:Image});
        const imagenUrl =URL.createObjectURL(blob);
        return imagenUrl;
    }
    else
    {
        const imagenUrl= principal;
        return imagenUrl;
    }
}







export const Propiedades=()=>
{
    



    //
    let verDetallesPropiedad=false;
   function cambiarVerMas(e)
   {
        verDetallesPropiedad= !verDetallesPropiedad;
        console.log(e)

   }

    //conexion con la api
    const[propiedades,setPropiedades]=useState([]);
    useEffect(
     ()=>{
        try {
                     fetch("https://asesoresguzman.com/api/load")
         .then(
             response=> response.json()
         )
         .then(data=>setPropiedades(data))
        } catch (error) {
            console.log(error)
        }

         
     },[]
    )
    setPropiedades( (propiedades)=>{
        
        Object.keys(propiedades).forEach(
            (propiedad)=>
            {
                propiedad.push({
                    visible:true
                })
            }
        )
        return propiedades
    })

    return(
        
        <div>
            <div className='propiedades'>
                {

                    propiedades.length >0 ?(
                    propiedades.map((propiedad,index)=>
                    (
                        <div  key={index}>
                            <div className='propiedad'>
                                <div className='contenedorPropiedadImagen'>
                                    <img className='propiedadImagen' src={convertirBufferaImagen(propiedad.imagen.data)} ></img>
                                </div>
                                <div className='contenedorInfo'>
                                    <div className='contenedorEtiquetas'>
                                        <span className='contenedorTipoVentaRenta'>{propiedad.tipoVentaRenta}</span>
                                        <span className='contenedorTerrenoVivienda'>{propiedad.tipoTerrenoVivienda}</span>
                                    </div>
                                    <div className='contenedorDetalles'>
                                        <div className='contenedorDetallesPrincipal'>
                                            <h2>{propiedad.nombre}</h2>
                                            <h4>{propiedad.inicial}</h4>
                                            <h4>{propiedad.precio}</h4>
                                            <h4>{propiedad.terrenoMT}</h4>
                                            <h4>{propiedad.construccionMT}</h4>
                                        </div>
                                        {
                                         verDetallesPropiedad==true?    
                                                <div id='contenedorDetallesSecundarios' className='contenedorDetallesSecundarios'>
                                                    <h4>{propiedad.niveles}</h4>
                                                    <h4>{propiedad.habitaciones}</h4>
                                                    <h4>{propiedad.bathroom}</h4>
                                                    <h4>{propiedad.descripcion}</h4>
                                                    <h4>{propiedad.cocina}</h4>
                                                    <h4>{propiedad.piscina}</h4>
                                                    <h4>{propiedad.jacuzy}</h4>
                                                    <h4>{propiedad.lavado}</h4>
                                                    <h4>{propiedad.comedor}</h4>
                                                </div>
                                            :<span></span>
                                        }
                                    </div>
                                </div>
                                <button  className='botonVerMas' onClick={cambiarVerMas}>Ver Mas</button>
                            </div>

                        </div>
                    ))
                ):(<div>No se encontraron propiedades</div>)
                }

            </div>
        </div>
    )
}
